package com.bit.std_1st.vo;

public class StarVo {
	double avg;
	int count;
	
	public StarVo() {
		// TODO Auto-generated constructor stub
	}

	public StarVo(double avg,int count) {
		super();
		this.avg = avg;
		this.count= count;
	}

	public double getAvg() {
		return avg;
	}

	public void setAvg(double avg) {
		this.avg = avg;
	}

	public int getCount() {
		return count;
	}

	public void setCount(int count) {
		this.count = count;
	}
	
	
	
}
